import { Link } from 'react-router-dom';

function NoMatch() {
  return (
    <main id="main">
	    <div className="container p-5">
	      <h2>Nothing to see here!</h2>
	      <p>
	        <Link to="/">Go to the home page</Link>
	      </p>
	    </div>
    </main>
  );
}

export default NoMatch;
